import json
import gurobipy as gp
from gurobipy import GRB

def tsp_json(n: int) -> str:
    """
    Return a JSON string describing a TSP instance with `n` nodes.
    The graph is a complete directed graph with unit edge weights.
    """
    # Build the node list
    nodes = [f"node{i+1}" for i in range(n)]

    # Build the edge list
    edges = []
    for i in range(n):
        for j in range(n):
            if i != j:
                edges.append({
                    "from": nodes[i],
                    "to":   nodes[j],
                    "cost": 1
                })

    # Build the node variables (binary)
    node_vars = {node: {"type": "int", "min": 0, "max": 1} for node in nodes}

    # Build the node constraints (each node visited exactly once)
    node_constraints = []
    for node in nodes:
        node_constraints.append({
            "vars": [node],
            "min": 1,
            "max": 1
        })

    # Build the edge variables (binary)
    edge_vars = {f"{e['from']}_{e['to']}": {"type": "int", "min": 0, "max": 1}
                 for e in edges}

    # Build the edge constraints (each node has exactly one outgoing and one incoming edge)
    edge_constraints = []
    for node in nodes:
        # Outgoing
        edge_constraints.append({
            "vars": [f"{node}_{v}" for v in nodes if v != node],
            "min": 1,
            "max": 1
        })
        # Incoming
        edge_constraints.append({
            "vars": [f"{u}_{node}" for u in nodes if u != node],
            "min": 1,
            "max": 1
        })

    # Build the subtour elimination constraints (Miller__ucker__emlin)
    subtour_constraints = []
    for i in range(n):
        for j in range(n):
            if i != j:
                subtour_constraints.append({
                    "from": nodes[i],
                    "to":   nodes[j],
                    "u_from": f"u_{nodes[i]}",
                    "u_to":   f"u_{nodes[j]}",
                    "y":      f"{nodes[i]}_{nodes[j]}",
                    "min": 0,
                    "max": 1
                })

    # Assemble the full JSON structure
    data = {
        "nodes": nodes,
        "edges": edges,
        "node_vars": node_vars,
        "node_constraints": node_constraints,
        "edge_vars": edge_vars,
        "edge_constraints": edge_constraints,
        "subtour_constraints": subtour_constraints
    }

    return json.dumps(data, indent=2)

# Example usage:
print(tsp_json(4))

