        expr += term["coef"] * vars[term["var"]]
    sense = con["sense"]
    rhs = con["rhs"]
    name = con["name"]
    if sense == "==":
        m.addConstr(expr == rhs, name=name)
    elif sense == "<=":
        m.addConstr(expr <= rhs, name=name)
    elif sense == ">=":
        m.addConstr(expr >= rhs, name=name)

# Optimize
