# Load the specification
spec = json.loads(spec_json)

# Create the model
m = gp.Model("TranspiledModel")

# Create variables
vars = {}
for name, vspec in spec["variables"].items():
    lb = vspec.get("lb")
    if lb is None:
        lb = 0.0
    ub = vspec.get("ub")
    if ub is None:
        ub = GRB.INFINITY
    # vtype "C" corresponds to continuous
    var_obj = m.addVar(lb=lb, ub=ub, vtype=GRB.CONTINUOUS, name=name)
    vars[name] = var_obj

# Set objective
obj_terms = spec["objective"]["linear_terms"]
obj_expr = gp.LinExpr()
for term in obj_terms:
    obj_expr += term["coef"] * vars[term["var"]]
obj_expr += spec["objective"].get("constant", 0)
sense = spec["objective"]["sense"].lower()
if sense == "max":
    m.setObjective(obj_expr, gp.GRB.MAXIMIZE)
elif sense == "min":
    m.setObjective(obj_expr, gp.GRB.MINIMIZE)
else:
    # Default to maximize if unspecified
    m.setObjective(obj_expr, gp.GRB.MAXIMIZE)

# Add constraints
for con in spec["constraints"]:
    lhs_terms = con["linear_lhs"]
    lhs_expr = gp.LinExpr()
    for term in lhs_terms:
        lhs_expr += term["coef"] * vars[term["var"]]
    sense = con["sense"]
    rhs = con["rhs"]
    if sense == "==":
        m.addConstr(lhs_expr == rhs)
    elif sense == "<=":
        m.addConstr(lhs_expr <= rhs)
    elif sense == ">=":
        m.addConstr(lhs_expr >= rhs)
    else:
        # Unsupported sense; skip
        pass

# Optimize
m.optimize()

# Print results
print("\nSolution status:", m.Status)
print("Objective value:", m.ObjVal)
for name, var_obj in vars.items():
    print(f"{name} = {var_obj.X}")

# Global variables for external use
global_solution = {name: var_obj.X for name, var_obj in vars.items()}
global_obj_value = m.ObjVal
global_status = m.Status

