# Create variables
vars = {}
for varname, varinfo in spec["variables"].items():
    lb = varinfo.get("lb")
    ub = varinfo.get("ub")
    vtype_str = varinfo.get("vtype", "C")
    if ub is None:
        ub = GRB.INFINITY
    if lb is None:
        lb = 0.0
    if vtype_str == "C":
        vtype = GRB.CONTINUOUS
    else:
        vtype = GRB.CONTINUOUS  # default to continuous if unknown
    vars[varname] = m.addVar(lb=lb, ub=ub, vtype=vtype, name=varname)

# Set objective
obj = spec["objective"]
sense = obj["sense"]
expr = sum(term["coef"] * vars[term["var"]] for term in obj["linear_terms"])
expr += obj.get("constant", 0)
if sense.lower() == "maximize":
    m.setObjective(expr, GRB.MAXIMIZE)
else:
    m.setObjective(expr, GRB.MINIMIZE)

# Add constraints
for cons in spec["constraints"]:
    name = cons["name"]
    rhs = cons["rhs"]
    sense = cons["sense"]
    expr = sum(term["coef"] * vars[term["var"]] for term in cons["linear_lhs"])
    if sense == "==":
        m.addConstr(expr == rhs, name)
    elif sense == "<=":
        m.addConstr(expr <= rhs, name)
    elif sense == ">=":
        m.addConstr(expr >= rhs, name)
    else:
        raise ValueError(f"Unsupported constraint sense: {sense}")

# Optimize
m.optimize()

# Store objective value for downstream use
RESULT_OBJ = float('nan')
try:
    if m.Status in (GRB.OPTIMAL, GRB.SUBOPTIMAL):
        RESULT_OBJ = m.objVal
except Exception:
    pass

# Human inspection output
print(f"Objective value: {m.objVal}")
for name, var in vars.items():
