for var_name, var_info in data["variables"].items():
    lb = var_info.get("lb", 0.0)
    ub = var_info.get("ub")
    if ub is None:
        ub = GRB.INFINITY
    vtype_str = var_info.get("vtype", "C")
    if vtype_str == "C":
        vtype = GRB.CONTINUOUS
    elif vtype_str == "I":
        vtype = GRB.INTEGER
    elif vtype_str == "B":
        vtype = GRB.BINARY
    else:
        vtype = GRB.CONTINUOUS
    var = model.addVar(lb=lb, ub=ub, vtype=vtype, name=var_name)
    var_dict[var_name] = var

# ------------------------------------------------------------------
# 2. Add constraints
# ------------------------------------------------------------------
for cons in data["constraints"]:
    expr = 0
    for term in cons["linear_lhs"]:
        coef = term["coef"]
        var = var_dict[term["var"]]
        expr += coef * var
    sense = cons["sense"]
    rhs = cons["rhs"]
    name = cons["name"]
    if sense == "<=":
        model.addConstr(expr <= rhs, name=name)
    elif sense == ">=":
        model.addConstr(expr >= rhs, name=name)
    elif sense == "==":
        model.addConstr(expr == rhs, name=name)
    else:
        # Unsupported sense; skip or raise an error
        raise ValueError(f"Unsupported constraint sense: {sense}")

# ------------------------------------------------------------------
# 3. Set objective
# ------------------------------------------------------------------
obj_expr = 0
for term in data["objective"]["linear_terms"]:
    coef = term["coef"]
    var = var_dict[term["var"]]
    obj_expr += coef * var
# The constant term is ignored by Gurobi; it does not affect the optimum
model.setObjective(obj_expr, GRB.MAXIMIZE)

# ------------------------------------------------------------------
# 4. Optimize
# ------------------------------------------------------------------
model.optimize()

# ------------------------------------------------------------------
# 5. Retrieve the objective value
# ------------------------------------------------------------------
RESULT_OBJ = None
if model.status == GRB.OPTIMAL:
    RESULT_OBJ = model.objVal
    print("\nOptimal objective value:", RESULT_OBJ)
else:
    print("\nOptimization did not find an optimal solution.")
    print("Status:", model.status, "(", gp.GRB.Status[model.status], ")")

# ------------------------------------------------------------------
# 6. Print variable values
# ------------------------------------------------------------------
print("\nVariable values:")
for var_name, var in var_dict.items():
    print(f"  {var_name} = {var.X:.6f}")

