spec = json.loads(spec_json)

# Create model
m = gp.Model("TranspiledModel")

# Dictionary to hold variable objects
vars = {}

# Add variables
for var_name, var_spec in spec["variables"].items():
    lb = var_spec.get("lb")
    ub = var_spec.get("ub")
    vtype = var_spec.get("vtype")
    # Handle None values
    if lb is None:
        lb = 0.0
    if ub is None:
        ub = GRB.INFINITY
    # Map vtype string to GRB type
    if vtype == "C":
        gbt = GRB.CONTINUOUS
    elif vtype == "B":
        gbt = GRB.BINARY
    else:
        gbt = GRB.CONTINUOUS  # default fallback
    var = m.addVar(lb=lb, ub=ub, vtype=gbt, name=var_name)
    vars[var_name] = var

# Set objective
obj_expr = 0
for term in spec["objective"]["linear_terms"]:
    coef = term["coef"]
    var_name = term["var"]
    obj_expr += coef * vars[var_name]
# Add constant if present
obj_const = spec["objective"].get("constant", 0)
if obj_const != 0:
    obj_expr += obj_const
m.setObjective(obj_expr, GRB.MINIMIZE)

# Add constraints
for con in spec["constraints"]:
    expr = 0
    for term in con["linear_lhs"]:
        coef = term["coef"]
        var_name = term["var"]
        expr += coef * vars[var_name]
    sense = con["sense"]
    rhs = con["rhs"]
    if sense == "<=":
        m.addConstr(expr <= rhs, name=con["name"])
    elif sense == ">=":
        m.addConstr(expr >= rhs, name=con["name"])
    else:
        # Unsupported sense; skip or raise error
        pass

# Optimize model
m.optimize()

# Global variable for objective value
RESULT_OBJ = float('nan')
try:
    if m.Status in (GRB.OPTIMAL, GRB.SUBOPTIMAL):
        RESULT_OBJ = m.objVal
except Exception:
    pass

# Print objective value
print(f"Objective value: {m.objVal}")

