import gurobipy as gp
from gurobipy import GRB

# Create model
m = gp.Model("TranspiledModel")

# Dictionary to store variables
vars = {}

# Add binary variables y_1 ... y_7
for i in range(1, 8):
    name = f"y_{i}"
    vars[name] = m.addVar(vtype=GRB.BINARY, lb=0, ub=1, name=name)

# Add continuous variables x_i_j (i=1..7, j=1..5)
for i in range(1, 8):
    for j in range(1, 6):
        name = f"x_{i}_{j}"
        vars[name] = m.addVar(vtype=GRB.INTEGER, lb=0.0, ub=GRB.INFINITY, name=name)

# Set linear objective: sum of all variables
obj_expr = gp.LinExpr()
for var in vars.values():
    obj_expr += var
m.setObjective(obj_expr, GRB.MINIMIZE)

# Add flow constraints (flow_1 ... flow_5)
for j in range(1, 6):
    expr = gp.LinExpr()
    for i in range(1, 8):
        expr += vars[f"x_{i}_{j}"]
    m.addConstr(expr >= 0, name=f"flow_{j}")

# Add capacity constraints (cap_1 ... cap_7)
for i in range(1, 8):
    expr = gp.LinExpr()
    for j in range(1, 6):
        expr += vars[f"x_{i}_{j}"]
    m.addConstr(expr <= 0, name=f"cap_{i}")

# Add nonnegativity constraints for each x variable (redundant but included)
for i in range(1, 8):
    for j in range(1, 6):
        name = f"x_{i}_{j}"
        m.addConstr(vars[name] >= 0, name=f"nonneg_{name}")

# Optimize the model
m.optimize()

# Store objective value for downstream use
RESULT_OBJ = float('nan')
try:
    if m.Status in (GRB.OPTIMAL, GRB.SUBOPTIMAL):
        RESULT_OBJ = m.objVal
except Exception:
    pass

# Print objective value
print(f"Objective value: {m.objVal}")

# Print variable values greater than 1e-9
for name, var in vars.items():
    try:
        val = var.X
        if abs(val) > 1e-9:
            print(f"{name} = {val}")
    except AttributeError:
        # Variable value not available if model not solved
        pass
